#region 1  -  Initialize Global Variables
    # Global Functions & Scriptblocks
        Function Global:Dec64 { Param($a) $b = [System.Text.Encoding]::ASCII.GetString([System.Convert]::FromBase64String($a));Return $b };
        Function Global:Enc64 { Param($a) $b = [System.Convert]::ToBase64String($a.ToCharArray());Return $b };
       $Global:sbADSI = { Param($trg)([adsi]"LDAP://$trg,$(([adsi]'').distinguishedname)").psbase.Children };
        $Global:locProfiles = [Ordered]@{
            AllUsersAllHosts       = $profile.AllUsersAllHosts
            AllUsersCurrentHost    = $profile.AllUsersCurrentHost
            CurrentUserAllHosts    = $profile.CurrentUserAllHosts
            CurrentUserCurrentHost = $profile.CurrentUserCurrentHost
            }

    # Global Help & Regex
        $Global:rgx = [psCustomObject]@{
            Help = ''
            psHelp = ''
            Email = "^[\w.]+@[\w.]+$"
            SAM = '^[a-zA_Z.]+\\[a-zA_Z.]+$'
            SID = '^S-\d{1}-\d{1}-\d{2}-+'
            GUID = '{\w{8}-\w{4}-\w{4}-\w{4}-\w{12}}'
            UNC = '\\\\[a-zA_Z.]+\\[a-zA_Z.]+'
            IP = '^(?:[0-9]{1,3}\.){3}[0-9]{1,3}$'
            MAC = '^([0-9A-Fa-f]{2}[:-]){5}([0-9A-Fa-f]{2})$'
            #Email2 = "^[\w.]+@$($env:userdnsdomain.ToLower())$"
            JVFull = '^j(dk|re)\-[678]u[0-9][0-9]\-windows-(i586|x64)\.exe$'
            JVMSI  = '^j(dk|re)1.[678].0_[0-9][0-9](_x64.msi|.msi)$'
            rsopU  = '(^q[1-9]\:|^q1[01]\:)'
            rsopC  = '(^q1[2-9]\:|^q2[0-9]\:)'
            cdata  = 'CDATA\[.*]]'
            cleanCode  = '((?<=[\=\,\\])(dhs|dmz|hsdn)|22\.[67]|SVR\d{3,4}|WKS\d{3,4}|\d{6}\-|\d{6}\-[SW])'
            };
        $Global:rgxHelp = { Dec64 $rgx.Help | SC ( $fl = 'C:\Temp\rgxtmp.mht'); & "C:\Program Files\Internet Explorer\iexplore.exe" $fl};
        $Global:rgxpsHelp = { Dec64 $rgx.psHelp | SC ( $fl = 'C:\Temp\rgxtmp2.mht'); & "C:\Program Files\Internet Explorer\iexplore.exe" $fl};
        $Global:libHelp = { Dec64 $Repos.Help | SC ( $fl = 'C:\Temp\libtmp.mht'); & "C:\Program Files\Internet Explorer\iexplore.exe" $fl};
        If ((Get-Host).Version.Major -gt '2'){ $Global:Repos = [Ordered]@{Help = ''}; };

    # Global Formatting
        $Global:psTab = "`t";
        $Global:psCRLF = [Environment]::NewLine # "$([Char]([int]13))$([Char]([int]10))";
        $Global:GUIDPtrn = [Convert]::ToString((get-date "9/15/63" -f "MMddyyyy"),16);
        If ((Get-Alias).Name -notcontains 'Out-ClipBoard'){
            Set-Alias Out-ClipBoard $env:SystemRoot\System32\clip.exe -Scope Global
            }
        $Global:dlAZCopy = 'http://aka.ms/downloadazcopy'

    # Global Net/Sec Config
        $Global:infAD = [psCustomObject]@{} | Select-Object DCs,Sites,LDCenter,DCtr1,DCtr2,ADCenter,FDCenter;
        $Global:infDomain = @{} | Select-Object DName,OU1,Dom,fqdnRoot,ipDnsSvrs,swRoot;
        $Global:infPolicy = @{} | Select-Object polRoot;
        $Global:infScript = @{} | Select-Object srcDrv,ScriptRoot,prefWrkSpace;
            $infScript.ScriptRoot = "$env:OneDriveConsumer\Documents\WindowsPowerShell\Scripts"

        $infScript.prefWrkSpace = [environment]::GetFolderPath('Desktop');
        $ActvNetAdp = gwmi Win32_NetworkAdapterConfiguration | Where-Object{$_.ipaddress} | Where-Object{$_.DefaultIPGateway}
        $infDomain.ipDnsSvrs = $ActvNetAdp | Select-Object -Exp DNSServerSearchOrder -First 1 

    # Global Tools
        $Global:dirISEBU = "$env:OneDriveConsumer\Documents\WindowsPowerShell\ISE_BUs"
        $Global:Systernals = "$env:SystemDrive\SysinternalsSuite";
        $Global:ScriptRoot = $infScript.ScriptRoot
        $Global:psGitRepos = "$env:OneDriveConsumer\Documents\GIT Repositories"

    # Global Module Data
        $Global:psArchive = [xml](Get-Content "$($psRoot -replace '\\+[^\\]+$')\GIT Repositories\Code - Personal\01 - MyPSRepos\INWORK\Repos.ps1xml") 
        $Global:ModuleData = [psCustomObject]@{} | Select-Object prefNet,xmlRepos,ModuleList,ModuleScan,DataTypes,ModuleXML;
#endregion 1
#region 1a -  Initialize extra Profile Functions
    $Global:prfAdd = "$($profile -replace "\\+[^\\]+$")\ProfileAdds"
    "Azure","DirServices","CodeAssist","FileSystem","HyperV","Network",
    "Security","DSC","Labs","Wifi" | ForEach-Object{
        Import-Module "$prfAdd\CM.PS_$_`_profile.psm1" #-Verbose
        }
