    # & { IEX "$(((gc $profile).split([char]10))[1..6]|Out-String)`t`t}" }
    # $Global:infDomain = @(([adsi]'').distinguishedname,"OU=$($env:UserDomain),","OU=$($env:UserDomain)_NEW,",$env:UserDomain,$env:UserDNSDomain).ToLower()
    $mods = ($Env:PSModulePath.Split(';') | Where-Object {-not [string]::IsNullOrEmpty($_)})
    $Global:uModz = ($mods | ForEach-Object{If((Test-Path $_) -eq $True){ Get-ChildItem $_ -Directory }}).Name |Sort-Object -Unique
    Switch ($envLoc){
        "HNet1"{
            $rgxM = [regex]'^(AutomatedLab$|AzureRM$|Hyper-V$|ISE).*$'
            } #HNet1
        "WNet1"{
            $infDomain.DName = $([string]([adsi]'').distinguishedname);
            $infDomain.OU1 = "OU=$($env:UserDomain),";
            $infDomain.Dom = $($env:UserDomain);
            $infDomain.fqdnRoot = $(($env:UserDNSDomain).ToLower());
            $infDomain.SwRoot = "\\$($infDomain.Dom)\root";
            $infPolicy | ForEach-Object{ $_.polRoot = "\\$($infDomain.Dom)\SYSVOL\$($infDomain.fqdnRoot)\Policies" }

            $infAD.DCs = ((& $sbADSI 'ou=domain controllers' | Select-Object -exp Path)|ForEach-Object{($_).Split(',')[0]}|Where-Object{$_ -match "(\-DC)"}) -Replace "LDAP://CN=";
            $Global:spltDNSDomain = @($($infDomain.fqdnRoot).split("."));

            $rgxM = [regex]'^fn_(Com|Exch|Fire|For(ens|mWiz)|iLO|Inwork|Java|LanD|Med|Mon|Pat|Print|pwrG|Qu|Rem|Soft|SPS|System|Thin|USMT).*$'
            } #WNet1 Prod
        } #Switch
#endregion Initialize ENV-specific Global Variables
#region 3  -  Initialize Remaining Global Variables
    $ModuleData.prefNet = $envLoc;
    $ModuleData.xmlRepos = $codeLib;
    $ModuleData.ModuleXML = ([xml](Get-Content $ModuleData.xmlRepos));
    $ModuleData.DataTypes = (($ModuleData.ModuleXML.ChildNodes|Get-Member)|Where-Object{$_.MemberType -eq 'Property'}).Name;
    $ModuleData.DataTypes | ForEach-Object{ Add-Member -InputObject $ModuleData -Name "xml$_" -Type NoteProperty -Value ($ModuleData.ModuleXML.Repository.$_) };
    $Global:lstModz = $ModuleData.DataTypes;$Global:lstModzCont=$ModuleData.ModuleXML.Repository;
        $ModuleData.ModuleList = $lstModzCont.Modules.Module | Select-Object Name,ModuleVersion,Description | Sort-Object Name;
        $ModuleData.ModuleScan = ($lstModz | ForEach-Object{Try{ $lstModzCont.$_."$($_.TrimEnd($_[-1]))" | Select-Object -EXP Module}Catch{}}) | Sort-Object -Unique;
        $ModuleData.ModuleScan = $ModuleData.ModuleScan | Where-Object{![string]::IsNullOrEmpty($_)};
        $Global:sb_ReloadModz = { Invoke-Expression "$((Get-Content "$($ScriptRoot -replace '\\+[^\\]+$')\CM.PowerShell_profile.ps1").split([char]10) |
             Where-Object{$_ -match 'ModuleData' -and $_ -notmatch 'sb_ReloadModz'} | Out-String)" };
        #region  -  Load Code Repository Helper Functions  --------------------------------------------------------------------------------
            $Global:lContent = $lstModzCont; $Global:list = $lstModz;
            [array]$Global:load = $ModuleData.xmlFunctions.Function | Where-Object{$_.Module -eq 'fn_ModuleTools'};
            ForEach ($a in $load){ 
                $fName = [string]$a.Name;
                $fCode = $a.Code.'#cdata-section' | ForEach-Object{ Dec64 $_ };
                $rcmd = [ScriptBlock]::Create(" Function Global:$fName {`n$fCode`t}");
                & $rcmd
                };
            'fn_ModuleTools' | ForEach-Object{ Load-Modules -trgModules $_ -vb -rtnData};
        #endregion  -  Load Code Repository Helper Functions  -----------------------------------------------------------------------------
        #region  -  Load Core Modules  ------------------------------------------------------------------------------------------------------
            $coreMods = 'fn_psTools','fn_Security',($uModz | Where-Object{($_ -match '^fn_')})#,($uModz | ?{($_ -match '(^Act|^Cim|^Grou)')})
            $coreMods | ForEach-Object{ Load-Modules -trgModules $_ -rtnData} #,'fn_GPOs'
        #endregion  -  Load Core Modules  ---------------------------------------------------------------------------------------------------
        #region  -  Load ENV Specific Modules  ------------------------------------------------------------------------------------------------------
            $envMods = $uModz | ForEach-Object{ Try {$rgxM.Matches($_) | ForEach-Object{ $_.Captures[0].Value }} Catch {} }
            $ErrorActionPreference = 'Stop'
            $envMods | ForEach-Object{ Try {Load-Modules -trgModules $_ -rtnData}Catch{Write-warning "$_ Not Loaded"}} #,'fn_GPOs'
            $ErrorActionPreference = 'Continue'
        #endregion  -  Load Core Modules  ---------------------------------------------------------------------------------------------------
    $Env:PSModulePath = ((
        $(Try { [Environment]::GetEnvironmentVariable("PSModulePath", "Machine").Split(';')} Catch {}) + `
        $(Try { [Environment]::GetEnvironmentVariable("PSModulePath", "User").Split(';')} Catch {}) + `
        ($Env:PSModulePath.Split(';')) + `
        "$($infScript.ScriptRoot)\Modules" ) -replace '\\$' | Sort-Object -Desc -Unique) -join ';'
  $rgxM.Options.value__
